import time
import sys

def quick_sort(a, ini=0, fim=None):
    fim = fim if fim is not None else len(a)
    comparisons, swaps = 0, 0

    def particao(a, ini, fim):
        nonlocal comparisons, swaps
        pivo = a[fim - 1]
        i = ini
        for j in range(ini, fim):
            comparisons += 1
            if a[j] <= pivo:
                a[i], a[j] = a[j], a[i]
                i += 1
                swaps += 1

        return i - 1

    def _quick_sort(a, ini, fim):
        nonlocal comparisons, swaps
        if ini < fim:
            pp = particao(a, ini, fim)
            _quick_sort(a, ini, pp)
            _quick_sort(a, pp + 1, fim)

    # Increase recursion depth limit (use with caution)
    sys.setrecursionlimit(len(a) + 100)

    _quick_sort(a, ini, fim)
    return a, comparisons, swaps

